import Header from "./topnavbar";
import styled from "styled-components";
import { Container, Row } from "reactstrap";
const ContentsBody = styled.div`
  width: 100%;
  display: flex;
  justify-content: center;
`;

const ColPosition = styled(Col)`
  width: 100%;
  width: 100%;
  margin: 0;
  padding: 0;
`;
const Layout = ({ children }) => (
  <div>
    <Header />
    <ContentsBody>
      <Row>
        <ContentsBody lg="4" md="3"></ContentsBody>
        <ContentsBody lg="4" md="6" xs="12">
          {children}
        </ContentsBody>
        <ContentsBody lg="4" md="3"></ContentsBody>
      </Row>
    </ContentsBody>
  </div>
);

export default Layout;
